import React, { Component } from 'react';
import './App.css';
import Header from '../src/components/header/Header.js';
import Search from '../src/components/search/Search'
import TeacherFilter from '../src/components/filter/TeacherFilter';
import DurationFilter from '../src/components/filter/DurationFilter';

class App extends Component {
  render() {
    return (
      <div className="app">
        <Header />
        <h2 className="text">ONLINE YOGA CLASSES</h2>
        <div className="filter">
        <Search />
        <TeacherFilter />
        <DurationFilter />
        </div>
      </div>
    );
  }
}

export default App;
